import styled from "styled-components";

const DivModalStyled = styled.div`
  background-color: rgba(18, 18, 20, 0.5);
  width: 100vw;
  min-height: 100vh;
  position: absolute;
  top: 0rem;
  display: flex;
  align-items: center;
  .modalContainer {
    width: 23.063rem;
    margin: 0 auto;
    background-color: aqua;
  }
  @media (max-width: 500px) {
    .modalContainer {
      width: 96vw;
    }
  }
`;
export default DivModalStyled;
